import React, { Component } from 'react';

class Login extends Component {

    render() {
        return (
            <div class="container my-5">
            		<div class="row">
            			<div class="col-md-4 offset-4">
            				<h3 class="text-center">LOGIN</h3>
            					아이디 : <input type="text" placeholder="ID" id="mid" name="mid" class="form-control"/>
            					비밀번호 : <input type="password" placeholder="Password" id="mpassword" name="mpassword" class="form-control"/>
            					<div class="text-center">
            						<input  type="submit" value="로그인"  class="btn btn-primary my-3" style="width: 200px; background-color: #81CBEB"/>
            					</div>
            		</div>
            	</div>
            </div>
        );
    }
}
export default Login;
